import React from 'react';
import './App.css';
import Project from './components/Project';

const style = {
  divStyle: {
    fontFamily: 'Playfair Display'
  }
}

function App() {
  return (
    <div style={styles.divStyle} className="App">
      <Project />
    </div>
  );
}

export default App;
